import React, {Component} from 'react';

import Heading from './Heading';
import UsersList from './UsersList';

class Users extends Component {

    constructor() {
        super();
        this.state = {
            users: ['Adam', 'Olga', 'Kasia', 'Basia']
        }
    }

    addUser = () => {
        console.log('test');

    }

    render () {
        return (
            <div className="users">
                <Heading text="User's list"/>

                <from className="add-user-form" onSubmit={this.addUser}>
                    <input type="text" placeholder="Nazwa uzytkownika" />
                    <button>Add user</button>
                </from>

                <UsersList usersList={this.state.users}/>
            </div>
        );
    };
}

export default Users;
